import { StatusBar } from 'expo-status-bar';
import { Feather } from '@expo/vector-icons';
import React from 'react';
import {
  StyleSheet,
  Text,
  View,
  Image,
  SafeAreaView,
  FlatList,
  Alert
} from 'react-native';

export default function App() {
  return (
    <View id='total'>
      <View style={{width: 30}} />
      <SafeAreaView id='head' style={styles.header}>
        <Image
          source={require('./assets/instagram.png')}
          style={styles.instagram}
          resizeMode="contain"
        />

        <Feather
          name="inbox"
          size={30}
          color= 'black'
          style={styles.inboxIcon}
        />
      </SafeAreaView>


      <View id='body'>
        <FlatList>

        </FlatList>

      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  header: {
    flex: 1,
    flexDirection: 'row',
    backgroundColor: '#f3f6fa',
    alignItems: 'center',
    justifyContent: 'space-between',
  },
  instagram: {
    flex: 1,
    width: null,
    height: 45
  },
  inboxIcon: {
    marginRight: 15
  },
  avatarImage: {
    width: 60,
    height: 60,
    borderRadius: 60/2,
  }
});
